import React, { useEffect, useState } from 'react';

const MovieDetails = ({movieId}) => {
    const [id, setId] = useState(null);

    useEffect(() => {
        let id = movieId;
        setId(id);
    });

    return (
        <div>
            <h4>{id}</h4>
        </div>
    )
}

export default MovieDetails;
